    return (
        <div className="gridOne">
            <NavLink to="/ConstructorFrontTitle" className="btn">
                <img src="./images/Constructor/SilverCircul.png" alt=""/>
            </NavLink>
            <p className="InfoAboutAdressnik">30x30</p>
        </div>
    )
}

export default SilverCircul;
